let App=()=>{
  let showDetails=(e)=>{
    e.preventDefault();
    alert("Form Submitted");
  }
  return(
    <>
      <div className='container'>
        <form onSubmit={showDetails}>
          <div className='fname'>
            <input type='text' name='fName' placeholder='Enter Your First Name'/>
          </div>
          <div></div>
        </form>
      </div>
    </>
  )
}

export default App;
